  false,\n\t\"url\": null,\n\t\"notes\": \"The annual work plan for Region 5 discusses
  the goals and objectives of the Inventory and Monitoring (I&M) program for fiscal
  year 2012. The introduction includes the purpose of the I&M initiative, I&M initiative
  and emphasized work areas, integration of I&M with the regional refuge biology and
  other Fish and Wildlife Service programs, and coordination with partners including
  Landscape Conservation Cooperatives (LCCs). Next, staffing, planned activities and
  anticipated products, and budget narrative and budget are covered. Appendices follow.\",\n\t\"owner_org\":
